    public function ayo() {
        # Use the Curl extension to query Google and get back a page of results
		//$url = "https://192.168.13.12/formbotps/?command=cco&kodesaham=bbri";
		//$url = "https://ami.panensaham.com/?command=cco&kodesaham=bbri";
		$url = "https://bot.panensaham.com/formbotps/?command=cah&kodesaham=UNVR";
		$ch = curl_init();
		$timeout = 5;
		curl_setopt($ch, CURLOPT_URL, $url);
		curl_setopt($ch, CURLOPT_RETURNTRANSFER, 1);
		curl_setopt($ch, CURLOPT_CONNECTTIMEOUT, $timeout);
		$html = curl_exec($ch);
		curl_close($ch);

		# Create a DOM parser object
		$dom = new \DOMDocument();

		# Parse the HTML from Google.
		# The @ before the method call suppresses any warnings that
		# loadHTML might throw because of invalid HTML in the page.
		@$dom->loadHTML($html);

		# Iterate over all the <a> tags
		foreach($dom->getElementsByTagName('img') as $link) {
				# Show the <a href>
				echo $link->getAttribute('src');
				echo "<br />";
		}
    }

